function zongjiechoice(cd,name) 
tmp={} 
for k,v in pairs(cd) do 
tmp[#tmp+1]={} 
tmp[#tmp]=cd[k][1] 
end 
ZJ=gg.choice(tmp,{},name)
if ZJ then ZJ1(cd[ZJ][2]) end 
end--核心配置不懂勿动
function ZJ1(method)
 load(method .. "()")() end--核心调用

